who thinks he speaks fluent hamster (but, in fact,
misunderstands every squeak that comes out of his
little pal's mouth), incorrectly thinks Abu's dying
wish is a trip to Blackpool. With Nan making three,
the trio embark on a road trip to the seaside town.
Unbeknownst to them, the Vet is actually the dirty
rotten henchman of Harry's evil twin brother Otto
(Matt Lucas), who was raised separately by Alsatians.
Addicted to Hula-Hoops and fueled by revenge, Otto's
